function App() {
  return (
    <React.Fragment style={{fontFamily: 'sans-serif'}}>
      <div style={{backgroundImage: 'url(https://image.freepik.com/free-photo/delicious-vietnamese-food-including-pho-ga-noodles-spring-rolls-white-table_181624-34062.jpg)'}}>
